import base64,os,time

filepath = os.path.join(os.path.dirname(os.path.abspath(__file__)),"pdf_bytes.txt")
def pdf_from_bytes_attr():
    base64_code = ''''''
    pdf_code =base64.b64decode(base64_code)
    print(type(pdf_code))
    f = open("fs1.pdf","wb")
    f.write(pdf_code)
    f.close()

def pdf_from_bytes_file():
    bytes_file = open(filepath, 'r')
    bytes = bytes_file.read()
    pdf_code = base64.b64decode(bytes)
    print(type(pdf_code))
    file_name = time.strftime("%Y%m%d--fs--%H%M%S") + ".pdf"
    pdf = open(file_name, "wb")
    pdf.write(pdf_code)
    pdf.close()


if __name__ =="__main__":
    pdf_from_bytes_file()